import React from 'react';
import img3 from './Images/img3.png';
import Typed from 'react-typed';
import Stickyicon from './Components/Stickyicon';
import SectionA from './SectionA';
import SectionService from './Components/SectionService';
import ServData from './Components/ServData';
const Home = ()=>{
    return(
        <>
        <br/>
        <br/>
        <br/>
       <div className='main-div align-items-center justify-content-center mb-5'>
        <div className="container align-items-center justify-content-center">
            <div className=' text text-center'>
            <Typed
                strings={[
                    'WEB DESIGNER',
                    'FRONTEND DEVELOPER',
                    'WEB DEVELOPER'
                    ]}
                    typeSpeed={60}
                    backSpeed={20}
                    loop >
                </Typed>
                </div>
                <h1 className='text-center '>Vishruti Agrawal</h1>
                <div className='row'>
                    <div className=' col-lg-6 col-md-6 col-12 mx-auto'>
                    <img src={img3} alt='img1..' className="ban-img align-items-center justify-content-center "/>
                  
        <div className=' col-lg-6 col-md-6 col-12  mx-auto text-center'>
            <p className='Ptext text-center'>I am a Web Designer and Developer practicing since 1.5 year.
             I love to Design and develope new web projects for the people.</p>
        </div>
       <div className='col-lg-6 col-md-6 col-12  mx-auto text-center'>
       <button className='btn btn-info mx-auto' btnLink='/project' >See My Work</button>
         </div>
       </div>
       </div>
       </div>
       <Stickyicon/>
       </div>
       <SectionA/>
       <div className='container mt-4 sect-S '>
            <h4 className='text-center'>WHAT I CAN DO FOR YOU</h4>
            <h1 className='text-center'>Services</h1>
                <div className='row mt-5 mb-5 d-flex'>
                    <div className='col-lg-4 col-md-6 col-sm-6 col-12'>
                    <div className='row '>
                        {
                            ServData.map((val,index)=>{
                                return <SectionService
                                key={index}
                                icon={val.icon}
                                title={val.title}
                                text={val.text}
                                />
                            })
                        }
                    </div>
                    </div>
                    </div></div>
                    <div className="my-5 ">
                        <h1 className="text-center  mt-4" style={{color:'rgb(0, 183, 255)'}}>Services</h1>
                        </div>
        <div className="container-fluid mb-5">
            <div className="row">
                <div className="col-10 mx-auto">
                <div className="row gy-1">
                   {
                       ServData.map((val,index)=>{
                           return <SectionService
                                key={index}
                               icon={val.icon}
                               title={val.title}
                               text={text}
                           />
                       })
                   }
                </div> 
                </div>
            </div>
        </div>
       
       
       
        </>
    );
};
export default Home;
